//SPDX-License-Identifier: MIT
pragma solidity >=0.4.4 <0.7.0;
pragma experimental ABIEncoderV2;

contract votacion {

    //Direccion del propietario del contrato
    address public owner;

    constructor () public {
        owner = msg.sender;
    }

    //Relacion entre el nombre del candidato y eñ hash de sus datos personales
    mapping (string => bytes32) IDCandidato;

    //Relacion entre el combre del candidato y el número de votos
    mapping (string => uint) VotosCandidato;

    //Lista para almacenar los nombres de los candidatos
    string[] candidatos;

    //Lista de los hashes de la identidad de los votantes
    bytes32[] votantes;

    function Representar(string memory _nombre) public {

    }
}

